jenkins:
  agentProtocols:
    - "JNLP4-connect"
    - "Ping"
  authorizationStrategy:
    loggedInUsersCanDoAnything:
      allowAnonymousRead: false
  clouds:
    - computeEngine:
        cloudName: "jenkins"
        configurations:
          - bootDiskAutoDelete: true
            bootDiskSizeGb: 20
            bootDiskSizeGbStr: "20"
            bootDiskSourceImageName: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/global/images/mvn-tf-1594991249"
            bootDiskSourceImageProject: "jenkins-instance-dev"
            bootDiskType: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/zones/us-central1-a/diskTypes/pd-standard"
            description: "f1-small intances for basic jenkins jobs"
            javaExecPath: "java"
            labelSet:
              - name: "basic"
            labelString: "basic"
            labels: "basic"
            launchTimeoutSeconds: 300
            launchTimeoutSecondsStr: "300"
            machineType: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/zones/us-central1-a/machineTypes/f1-micro"
            mode: NORMAL
            namePrefix: "small"
            networkConfiguration:
              autofilled:
                network: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/global/networks/default"
                subnetwork: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/regions/us-central1/subnetworks/default"
            numExecutors: 2
            numExecutorsStr: "2"
            preemptible: false
            region: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/regions/us-central1"
            retentionTimeMinutes: 15
            retentionTimeMinutesStr: "15"
            runAsUser: "jenkins"
            zone: "https://www.googleapis.com/compute/v1/projects/jenkins-instance-dev/zones/us-central1-a"
        credentialsId: "jenkins-gcp-cred"
        instanceCapStr: "2"
        instanceId: "dfa3bc01-8880-4ec6-8cb0-9ad95f3dc92e"
        projectId: "jenkins-instance-dev"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  labelAtoms:
    - name: "basic"
    - name: "master"
    - name: "small-okihi5"
  markupFormatter: "plainText"
  mode: NORMAL
  myViewsTabBar: "standard"
  numExecutors: 2
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
        - id: "admin"
          name: "Mauricio "
          properties:
            - "apiToken"
            - mailer:
                emailAddress: "mauric.mum@gmail.com"
            - preferredProvider:
                providerId: "default"
  slaveAgentPort: -1
  updateCenter:
    sites:
      - id: "default"
        url: "https://updates.jenkins.io/update-center.json"
  views:
    - all:
        name: "all"
  viewsTabBar: "standard"
security:
  apiToken:
    creationOfLegacyTokenEnabled: false
    tokenGenerationOnCreationEnabled: false
    usageStatisticsEnabled: true
  sSHD:
    port: -1
unclassified:
  buildDiscarders:
    configuredBuildDiscarders:
      - "jobBuildDiscarder"
  buildStepOperation:
    enabled: false
  defaultFolderConfiguration:
    healthMetrics:
      - worstChildHealthMetric:
          recursive: true
  extendedEmailPublisher:
    adminRequiredForTemplateTesting: false
    allowUnregisteredEnabled: false
    charset: "UTF-8"
    debugMode: false
    defaultBody:
      "$PROJECT_NAME - Build # $BUILD_NUMBER - $BUILD_STATUS:\r\n\r\nCheck\
      \ console output at $BUILD_URL to view the results."
    defaultContentType: "text/plain"
    defaultSubject: "$PROJECT_NAME - Build # $BUILD_NUMBER - $BUILD_STATUS!"
    maxAttachmentSize: -1
    maxAttachmentSizeMb: 0
    precedenceBulk: false
    useSsl: false
    watchingEnabled: false
  gitHubConfiguration:
    apiRateLimitChecker: ThrottleForNormalize
  gitHubPluginConfig:
    hookUrl: "http://35.224.62.193:8080/github-webhook/"
  gitSCM:
    createAccountBasedOnEmail: false
    showEntireCommitSummaryInChanges: false
    useExistingAccountWithSameEmail: false
  location:
    adminAddress: "Dirección no configurada todavía <nobody@nowhere>"
    url: "http://35.224.62.193:8080/"
  mailer:
    charset: "UTF-8"
    useSsl: false
    useTls: false
  pollSCM:
    pollingThreadCount: 10
  timestamperConfig:
    allPipelines: false
    elapsedTimeFormat: "'<b>'HH:mm:ss.S'</b> '"
    systemTimeFormat: "'<b>'HH:mm:ss'</b> '"
tool:
  git:
    installations:
      - home: "git"
        name: "Default"
